import React,{Component} from 'react';
import logo from './mainlogo.jpg';
import './mainpage.css';

class MainPage extends Component  {
	render() { 
  return (
    <div className="MainPgae" style='--homeCardImage: "C:/Project/demo-react/src/mainlogo.jpg"'>
		<div>Hello World</div>
    </div>
  );
	}
}

export default MainPage;
